import{_ as e,a as d,b as r}from"./chunks/kakuteh7_debug_swd_port.BBweMAHx.js";import{_ as l,E as o,c as i,J as h,m as t,a as s,ab as c,o as p}from"./chunks/framework.CUflZczI.js";const C=JSON.parse('{"title":"Holybro Kakute H7","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/kakuteh7.md","filePath":"uk/flight_controller/kakuteh7.md"}'),n={name:"uk/flight_controller/kakuteh7.md"},u=t("h1",{id:"holybro-kakute-h7",tabindex:"-1"},[s("Holybro Kakute H7 "),t("a",{class:"header-anchor",href:"#holybro-kakute-h7","aria-label":'Permalink to "Holybro Kakute H7"'},"​")],-1),b=c('<div class="warning custom-block"><p class="custom-block-title">PX4 не виробляє цей (чи будь-який інший) автопілот. Зверніться до <a href="https://holybro.com/" target="_blank" rel="noreferrer">виробника</a> щодо підтримки апаратного забезпечення чи відповідності вимогам.</p></div><p><a href="https://holybro.com/products/kakute-h7" target="_blank" rel="noreferrer">Holybro Kakute H7</a> є повним набором функцій, включаючи подвійні роз&#39;єми ESC 4in1 plug-and-play, роз&#39;єм для HD-камери, барометр, OSD, 6x UART, слот для картки пам&#39;яті Blackbox MicroSD, BEC на 5В та 9В, зручне розташування для паяння та багато іншого.</p><p>Kakute H7 базується на кращих рисах свого попередника, <a href="./../flight_controller/kakutef7.html">Kakute F7</a>, та подальші вдосконалюють апаратні компоненти та компонування. Подвійні роз&#39;єми підключення 4-в-1 ESC спрощують підтримку конфігурацій x8 та Octocopter, забезпечуючи простоту збирання.</p><p>Плата також має вбудований барометр, світлодіод &amp; п&#39;єзоімпульс, а також плату I2C (SDA &amp; SCL) для зовнішніх GPS/магнітомерів.</p><p><img src="'+e+'" alt="Kakute h7"></p><div class="info custom-block"><p class="custom-block-title">Цей польотний контролер <a href="./../flight_controller/autopilot_manufacturer_supported.html">підтримується виробником</a>.</p></div><h2 id="ключові-особливості" tabindex="-1">Ключові особливості <a class="header-anchor" href="#ключові-особливості" aria-label="Permalink to &quot;Ключові особливості&quot;">​</a></h2><ul><li>MCU: Процесор STM32H743 32-біт, який працює на частоті 480 МГц</li><li>IMU: MPU6000</li><li>Барометр: BMP280</li><li>OSD: AT7456E</li><li>Bluetooth-чіп на борту: вимкнено з PX4</li><li>2x порт JST-SH1.0_8pin (для одиночних або 4-в-1 ESCs, сумісний з x8/Octocopter plug &amp; play)</li><li>1x порт JST-GH1.25_6pin (для HD-системи, такої як Caddx Vista &amp; Air Unit)</li><li>Напруга вхідної батареї: 2S - 8S</li><li>BEC 5В 2A &amp;Cont.</li><li>BEC 9В 1.5A Cont.</li><li>Монтаж: 30,5 х 30,5 мм / отвір Φ4 мм з прокладками Φ3 люверси</li><li>Розміри: 35x35мм</li><li>Вага: 8г</li></ul><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><p>Плату можна придбати в одному з наступних магазинів (наприклад):</p><ul><li><a href="https://holybro.com/products/kakute-h7" target="_blank" rel="noreferrer">Holybro</a></li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p><em>Kakute H7</em> призначений для сумісної роботи з <em>Tekko32</em> 4-в-1 ESC і може бути придбаний в комплекті.</p></div><h2 id="конектори-та-контакти" tabindex="-1">Конектори та контакти <a class="header-anchor" href="#конектори-та-контакти" aria-label="Permalink to &quot;Конектори та контакти&quot;">​</a></h2><p>Це сілкскрін для <em>Kakute H7</em>, що показує верхню частину плати:</p><img src="'+d+'" width="380px" title="Kakute h7"><table><thead><tr><th>Пін</th><th>Функція</th><th>PX4 default</th></tr></thead><tbody><tr><td>B+</td><td>Позитивна напруга батареї (2S-8S)</td><td></td></tr><tr><td>SDA, SCL</td><td>Підключення I2C (для периферійних пристроїв)</td><td></td></tr><tr><td>5V</td><td>Вихід 5В (максимум 2A)</td><td></td></tr><tr><td>3V3</td><td>Вихід 3.3В (максимум 0.25A)</td><td></td></tr><tr><td>VI</td><td>Відеовхід з камери FPV</td><td></td></tr><tr><td>VO</td><td>Відеовихід на відеопередавач</td><td></td></tr><tr><td>CAM</td><td>Контроль OSD камери</td><td></td></tr><tr><td>G або GND</td><td>Заземлення</td><td></td></tr><tr><td>RSI</td><td>Аналоговий вхід RSSI (0-3,3 В) від приймача</td><td></td></tr><tr><td>R1, T1</td><td>UART1 RX та TX</td><td>TELEM1</td></tr><tr><td>R3, T3</td><td>UART3 RX та TX</td><td>Консоль відлагодження NuttX</td></tr><tr><td>R4, T4</td><td>UART4 RX та TX</td><td>GPS1</td></tr><tr><td>R6, T6</td><td>UART6 RX та TX (R6 також розташований в GH plug)</td><td>RC порт</td></tr><tr><td>R7</td><td>UART7 RX (RX знаходиться у роз&#39;ємах для використання з 4-в-1 ESC)</td><td>Телеметрія DShot</td></tr><tr><td>LED</td><td>Дріт сигнальний для адресованих світлодіодів WS2182 (не тестувався)</td><td></td></tr><tr><td>Z-</td><td>Негативна нога п&#39;єзожучка (Підключіть позитивну ногу динаміку до контакту 5В)</td><td></td></tr><tr><td>M1 to M4</td><td>Вихід сигналу двигуна (розташований у роз&#39;ємі для використання в 4-в-1 ESC)</td><td></td></tr><tr><td>M5 to M8</td><td>Вихід сигналу двигуна (розташований у роз&#39;ємі для використання в 4-в-1 ESC)</td><td></td></tr><tr><td>Boot</td><td>Кнопка завантажувача</td><td></td></tr></tbody></table><p><a id="bootloader"></a></p><h2 id="оновлення-завантажувача-px4" tabindex="-1">Оновлення завантажувача PX4 <a class="header-anchor" href="#оновлення-завантажувача-px4" aria-label="Permalink to &quot;Оновлення завантажувача PX4&quot;">​</a></h2><p>Плата поставляється із заздалегідь встановленою <a href="https://github.com/betaflight/betaflight/wiki" target="_blank" rel="noreferrer">Betaflight</a>. Перед встановленням прошивки PX4 необхідно прошити <em>заванажувач PX4</em>. Завантажте завантажувальний бінарний файл <a href="https://github.com/PX4/PX4-user_guide/raw/v1.15/assets/flight_controller/kakuteh7/holybro_kakuteh7_bootloader.hex" target="_blank" rel="noreferrer">kakuteh7_bl.hex</a> та прочитайте <a href="./../advanced_config/bootloader_update_from_betaflight.html">цю сторінку</a> для інструкцій з прошивки.</p><h2 id="створення-прошивки" tabindex="-1">Створення прошивки <a class="header-anchor" href="#створення-прошивки" aria-label="Permalink to &quot;Створення прошивки&quot;">​</a></h2><p>Щоб <a href="./../dev_setup/building_px4.html">створити PX4</a> для цієї цілі:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make holybro_kakuteh7_default</span></span></code></pre></div><h2 id="встановлення-прошивки-px4" tabindex="-1">Встановлення прошивки PX4 <a class="header-anchor" href="#встановлення-прошивки-px4" aria-label="Permalink to &quot;Встановлення прошивки PX4&quot;">​</a></h2><p>Прошивку можна встановити будь-якими звичайними способами:</p><ul><li><p>Збудуйте та завантажте джерело</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make holybro_kakuteh7_default upload</span></span></code></pre></div></li><li><p><a href="./../config/firmware.html">Завантажте прошивку</a> за допомогою <em>QGroundControl</em>. Ви можете використовувати або готове вбудоване програмне забезпечення, або власне користувацьке програмне забезпечення.</p></li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Якщо ви завантажуєте готове програмне забезпечення через QGroundcontrol, вам необхідно використовувати щоденну версію QGC або версію QGC новішу за 4.1.7.</p></div><h2 id="налаштування-px4" tabindex="-1">Налаштування PX4 <a class="header-anchor" href="#налаштування-px4" aria-label="Permalink to &quot;Налаштування PX4&quot;">​</a></h2><p>Крім <a href="./../config/">основної конфігурації</a>, важливі наступні параметри:</p><table><thead><tr><th>Параметр</th><th>Налаштування</th></tr></thead><tbody><tr><td><a href="./../advanced_config/parameter_reference.html#SYS_HAS_MAG">SYS_HAS_MAG</a></td><td>Це має бути вимкнено, оскільки у платі немає внутрішнього магніту. Ви можете активувати це, якщо приєднаєте зовнішній магніт.</td></tr></tbody></table><h2 id="зіставлення-послідовних-портів" tabindex="-1">Зіставлення послідовних портів <a class="header-anchor" href="#зіставлення-послідовних-портів" aria-label="Permalink to &quot;Зіставлення послідовних портів&quot;">​</a></h2><table><thead><tr><th>UART</th><th>Пристрій</th><th>Порт</th></tr></thead><tbody><tr><td>USART1</td><td>/dev/ttyS0</td><td>TELEM1</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>Консоль відладки</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>GPS1</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>RC SBUS</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Телеметрія ESC (DShot)</td></tr></tbody></table><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><h3 id="системна-консоль" tabindex="-1">Системна консоль <a class="header-anchor" href="#системна-консоль" aria-label="Permalink to &quot;Системна консоль&quot;">​</a></h3><p>UART3 RX та TX налаштовані для використання як <a href="./../debug/system_console.html">Системна Консоль</a>.</p><h3 id="swd" tabindex="-1">SWD <a class="header-anchor" href="#swd" aria-label="Permalink to &quot;SWD&quot;">​</a></h3><p><a href="./../debug/swd_debug.html">Інтерфейс SWD</a> (JTAG) має такі контакти:</p><ul><li><code>SWCLK</code>: Тестова точка 2 (Pin 72 на процесорі)</li><li><code>SWDIO</code>: Тестова точка 3 (Pin 76 на процесорі)</li><li><code>GND</code>: Як позначено на платі</li><li><code>VDD_3V3</code>: Як позначено на платі</li></ul><p>Ці показані нижче.</p><p><img src="'+r+'" alt="SWD Pins on Kakute H7 - CLK SWO"></p>',39);function k(m,_,f,S,g,P){const a=o("Badge");return p(),i("div",null,[u,h(a,{type:"tip",text:"PX4 v1.13"}),b])}c